import { Component } from '@angular/core';
import { NgForm } from '@angular/forms';
import { Empleado } from 'src/app/Clases/Empleado';
import { EmpleadoService } from 'src/app/servicios/Administrador/empleado.service';

@Component({
  selector: 'app-registroc',
  templateUrl: './registroc.component.html',
  styleUrls: ['./registroc.component.css']
})
export class RegistrocComponent {

  empleado:Empleado = new Empleado();

  constructor(private servicio:EmpleadoService){

  }

  public GuardarEmpleado(form:NgForm){
    let sucursal:String = form.value.sucursal;
    console.log('sucursal: ' + sucursal);

    this.empleado.sucursal = sucursal;
    console.log(this.empleado);

  }

  public Validar(){

  }
}

<body>
<div class="wrapper">
    <form #miFormulario="ngForm" (ngSubmit)="GuardarEmpleado(miFormulario)">
        <h1>Registro de Empleados</h1>
        <div class="input-box">
            <input type="text" placeholder="CUI" name="cui"  [(ngModel)]="empleado.cui" required #cui="ngModel">
            <i class='bx bxs-id-card'></i>
        </div>

        <div class="aler alert-danger mt-2" [hidden]="cui.valid">
            El cui es obligatorio
        </div>

        <div class="input-box">
            <input type="text" placeholder="Nombres" name="nombre" [(ngModel)]="empleado.nombre" #nombre="ngModel">
            <i class='bx bx-user'></i>
        </div>
        <div class="input-box">
            <input type="text" placeholder="Apellidos"  name=" apellido" [(ngModel)]="empleado.apellido">
            <i class='bx bx-user'></i>
        </div>
        <div class="input-box">
            <input type="date" placeholder="Fecha de Nacimiento" name="nacimiento" [(ngModel)]="empleado.nacimiento">

        </div>
        <div class="input-box">
            <input type="text" placeholder="Telefono"  name="telefono"  required [(ngModel)]="empleado.telefono">
            <i class='bx bx-phone'></i>
        </div>
        <div class="input-box">
            <input type="text" placeholder="Direccion" name="direccion"  [(ngModel)]="empleado.direccion">
            <i class='bx bx-building-house'></i>
        </div>
        <div class="input-box">
            <input type="text" placeholder="Sueldo" name="sueldo"  required [(ngModel)]="empleado.sueldo">
            <i class='bx bx-money-withdraw'></i>
        </div>
        <div class="input-box">
            <select [(ngModel)]="empleado.sucursal" name="sucursal" required>
                <option selected="true" disabled="disabled">Sucursal</option>
                <option>Central</option>
                <option>Norte</option>
                <option>Sur</option>
            </select>
            <i class='bx bxs-report' ></i>
        </div>
        <button type="submit" class="btn">Registrar Trabajador</button>
    </form>
</div>
</body>
